sys_variable_value.value:
var inputs = workflow.inputs;

var api = new x_neyu_modtrak.ModTrakAPI();

var response = api.search(
	inputs.u_change_number,
	inputs.u_approve_history
);

workflow.info("Status response: " + JSON.stringify(response));

if (response.error) {
    workflow.error(response.errorMessage);
	workflow.scratchpad.error = response.status + " " +
		response.errorMessage;
	activity.output = JSON.stringify(response);
    activity.result = "error";
} else {
	workflow.scratchpad.modtrak_status = response.result;
	activity.result = "success";
}

